import React from 'react';
import { getPlaceholderText } from '../../utils/formatters';

function Form({
  mode,
  setMode,
  gender,
  setGender,
  season,
  setSeason,
  eventType,
  setEventType,
  performance,
  setPerformance,
  points,
  setPoints,
}) {
  return (
    <form className="calculator-form">
      <div className="mode-toggle">
        <button
          type="button"
          className={mode === 'performance' ? 'active' : ''}
          onClick={() => setMode('performance')}
        >
          Performance → Points
        </button>
        <button
          type="button"
          className={mode === 'points' ? 'active' : ''}
          onClick={() => setMode('points')}
        >
          Points → Performance
        </button>
      </div>

      {/* Rest of the form */}
    </form>
  );
}

export default Form;
